import React from "react";

import "../styles/Footer.css";

function Footer() {
  return (
    <div className="footer">

      <p> &copy; 2023 DevRishi</p>
      <p>About</p>
      <p>In the fast-paced world of technology and healthcare, the integration of artificial intelligence (AI) has revolutionized the way we access information and services. Chatbots, in particular, have emerged as
         a versatile tool for enhancing customer experience and solving real-world problems. One promising avenue for the development of a profitable startup is a chatbot that suggests Ayurveda remedies. Ayurveda,
          an ancient Indian system of medicine, offers holistic solutions to various health issues. In this essay, we will explore how a chatbot focused on Ayurvedic remedies can evolve into a successful and profitable startup.</p>
    </div>
  );
}

export default Footer;
